    const [chef, setChef] = useState(false)


    return(
        <div>
        <hr />
            <h1>Search for The Registered Employees</h1>
        <hr />
            <div className='inf'>
                <button className={'btn btn-outline-' + (waiter ? 'danger': 'dark')}>
                    Search for Registered Waiters
                </button>
                <hr />
               {waiter && <Search table={'WAITER'} ></Search> }
            </div>
            <div className='aa'>
            <button>Search for Registered Chefs</button>
                <hr />
                {chef && <Search table={'CHEF'} ></Search> }
            </div>
        </div>
    )
}

export default REmployee;
